import Bio from "./bio";
const profile=(props)=>{
    const{name,age,bio}=props;
    return(
        <div>
            <h1>Profile</h1>
            <h2>Name:{name}</h2>
            <p>Age:{age}</p>
            <p>Bio bio={bio}</p>
        </div>
    )
}
export default profile;
